description:
EuroPark mobile app provides fast way to find a parking lot in Riga at a favorable cost and lets you pay for it. Using EuroPark mobile app is simple and convenient. 
EuroPark mobile app gives you option to look at the city map, browse zones and tariffs. It will find your location by using GPS. App allows you to register multiple cars at the same time and lets you pay for them simultaneously.
EuroPark is available for free.

How to use EuroPark app:
    • Download application;
    • Read and accepts Terms & Conditions;
    • Follow the registration steps;
    • Find the parking lot you need;
    • Register your car;
    • Pay for parking;

Download EuroPark app.

Elektrum lietotne – pārvaldiet savu enerģiju gudri!

Sekojiet līdzi un ātri risiniet visus ar enerģiju saistītus jautājumus Jūsu mājās un uzņēmumā.

Paziņojumi un rādījumi, maksājumi, atgādinājumi, biržas cenas, pārskati un e-veikals – tas viss un vēl vairāk atjaunotajā Elektrum lietotnē!

Jaunums! Saturs, kas pielāgojas Jums! Izvēlieties sev interesējošās sadaļas un sakārtojiet tā, lai ikdienā svarīgās lietas ir klikšķa attālumā.

Atrisiniet visus ar elektrību un dabasgāzi saistītos jautājumus: nododiet skaitītāju rādījumus, veiciet apmaksu, pievienojiet jaunus objektus, atjaunojiet personīgo informāciju, kā arī sekojiet līdzi savam aktuālajam patēriņam, salīdziniet to ar iepriekšējiem periodiem un saņemiet ieteikumus, kā saimniekot vēl efektīvāk, nezaudējot komfortu.

Elektrum Dinamiskais klienti var ietaupīt, izmantojot elektrības cenas svārstības biržā. Sekojiet līdzi aktuālajai elektrības cenai biržā un plānojiet elektroierīču izmantošanu tajās diennakts stundās, kad elektrība biržā ir lētāka. Saņemiet paziņojumus par cenas svārstībām un tērējiet enerģiju gudri.

Ar "Draudzīgajiem labumiem" enerģija nekad nebeidzas! Saņemiet īpašos piedāvājumus mūsu partneru produktiem un pakalpojumiem Elektrum lojalitātes programmas ietvaros.


Jums būs pieejamas sekojošas sadaļas un iespējas:

Privātpersonām

* NODOT RĀDĪJUMUS – ērts veids, kā nodot savus elektrības un gāzes skaitītāja rādījumus;
* VEIKT MAKSĀJUMUS – varēsiet veikt maksājumus par elektrību un dabasgāzi ar maksājumu karti vai internetbankā;
* MAKSĀJUMU PĀRSKATS – pilna maksājumu vēsture, lai varat sekot līdzi saviem maksājumiem par elektrību;
* PATĒRIŅA PĀRSKATS – iespēja sekot līdzi elektrības patēriņam ilgākā laika griezumā un apskatīt to grafika veidā;
* LĪGUMI – iespēja ērti pārskatīt esošo līgumu un pieteikt nepieciešamās korekcijas;
* KLIENTA INFORMĀCIJA – lai nepieciešamības vai izmaiņu gadījumā ērti varat to pārskatīt un aktualizēt;
* BIRŽAS CENAS – aktuāli tiem, kuri izvēlējušies produktu Elektrum Dinamiskais un/vai seko līdzi elektrības cenas izmaiņām biržā;
* ENERGO PULSS – palīdz saprast, cik efektīvi jūs ikdienā patērējat elektroenerģiju, un sniedz lietderīgus padomus, kā saimniekot apdomīgi, nezaudējot komfortu;
* ELEKTROAUTO UZLĀDE – īsceļš uz Elektrum Drive elektrotransporta uzlādi;
* ATGĀDINĀJUMI – saņemiet tālrunī atgādinājumu par elektrības un gāzes skaitītāju rādījumu ievadīšanu;
* DRAUDZĪGIE LABUMI – ērti apskatīt visus aktuālos “Draudzīgo labumu” piedāvājumus un iespēja saglabāt kuponu tālrunī;
* ENERGOEFEKTIVITĀTE – elektroierīču marķējumi, padomi enerģijas pārvaldīšanai mājoklī, semināri un daudz kas cits zaļākai nākotnei;
* E-VEIKALS – viedie mājas risinājumi, viedierīces, preces drošībai un apgaismojumam ar bezmaksas piegādi visā Latvijā;
* KONTAKTI – mūsu Klientu serviss vienmēr viena pogas spiediena attālumā.


Uzņēmumiem

* NODOT RĀDĪJUMUS – ērts veids, kā nodot savus elektrības skaitītāja rādījumus;
* MAKSĀJUMU PĀRSKATS – pilna maksājumu vēsture un salīdzināšanas akti;
* PATĒRIŅA PĀRSKATS – iespēja sekot līdzi elektrības patēriņam ilgākā laika griezumā un apskatīt to grafika veidā;
* LĪGUMI – iespēja ērti pārskatīt esošo līgumu un pieteikt nepieciešamās korekcijas;
* INDIVIDUĀLAIS KONSULTANTS – ērti sazinieties ar sava uzņēmuma konsultantu;
* KLIENTA INFORMĀCIJA – lai nepieciešamības vai izmaiņu gadījumā ērti varat to pārskatīt un aktualizēt;
* BIRŽAS CENAS – aktuāli tiem, kuri seko līdzi elektrības cenas izmaiņām biržā;
* ATGĀDINĀJUMI – saņemiet atgādinājumu par rādījumu ievadīšanu un/vai rēķinu apmaksu;
* KONTAKTI – mūsu Klientu serviss vienmēr viena pogas spiediena attālumā.
